import React from 'react'
import NdPage from './2ndPage.js'
import NameForm from './NameForm.js'

export default class Page1 extends React.Component {

    render(){
        if(this.props.isLog === true){
            return <NdPage/>;
        }
        return <NameForm/>;
    }

}
